				e.exports =
					'<h4 id="содержание">Содержание</h4>\n<ul>\n<li><a href="introduction/wallets.md">Кошелек</a></li>\n<li><a href="introduction/backups.md">Резервные копии</a></li>\n<li><a href="introduction/blockchain.md">Блокчейн</a></li>\n<li><a href="voting.md">Голосование</a></li>\n<li><a href="accounts/general.md">Аккаунты</a></li>\n<li><a href="accounts/permissions.md">Разрешения</a></li>\n<li><a href="accounts/membership.md">Подписки</a></li>\n<li><a href="assets/mpa.md">Привязанные к рынку активы</a> <ul>\n<li>bitUSD</li>\n<li>bitEUR</li>\n<li>bitGOLD</li>\n</ul>\n</li>\n<li><a href="assets/uia.md">Эмитированные пользователем активы</a></li>\n<li><a href="assets/privbitassets.md">Приватизированные BitAssets</a></li>\n<li><a href="dex/introduction.md">Децентрализованная биржа</a></li>\n<li><a href="dex/trading.md">Торговля</a></li>\n<li><a href="dex/shorting.md">Короткая продажа BitAssets</a></li>\n</ul>\n';
