			25566: (e) => {
				e.exports =
					'<h1 id="piyasa-sabitli-aktifler-mpa-market-pegged-assets">Piyasa Sabitli Aktifler (MPA-Market Pegged Assets)</h1>\n<p>Bitcoin&#39;e benzeyen özelliklerde ve avantajlarda, amerikan Doları gibi tüm dünya\ntarafından benimsenmiş bir parayla pariteyi koruyabilen bir kripto-paranın\n sansürsüz ve kolay bir ticaret için çok faydası vardır. Bu, META1&#39;in \npiyasaya  sabitli varlıkları (MPA) sayesinde mümkün olur. Bunlar, serbestçe \nalıp-satılabilen yeni  bir tür dijital varlıklardır. Bunların değerleri, fark-kontratı (CFD) yöntemiyle\ndayandıkları geleneksel varlıkların değerlerini takip etmek üzere dizayn edilmişlerdir. </p>\n<p><em>AkıllıPara</em> (eşanlamı MPA) , değerinin  <em>daima</em>  100% yada daha fazlası META1&#39;in \n ana para birimi (META1) ile desteklenen bir kripto-paradır. Bu <em>AkıllıParalar</em> herhangi bir \nzamanda bir fark-kontratı (CFD) içinde <em>teminat</em> olarak META1&#39;ye dönüştürülebilirler .</p>\n<p>Teminatla desteklenen FK&#39;nı andırmalarına rağmen PSV&#39;leri nadir yapan şey \nonların  karşı taraf riskinden muaf olmalarıdır. Bunun mümkün olması için teminatı \ngüvence  altına alma ve hesap görme işlemleri ağın  kendi sorumluluğuna bırakılmıştır<br>(yazılım protokolüyle uygulanarak) . Bu konunun detayları aşağıda\nanlatılacaktır.</p>\n';
			},
			96879: (e) => {
				e.exports =
					'<h1 id="özelleştirilmiş-bitaktifler-privatized-bitassets">Özelleştirilmiş BitAktifler (Privatized BitAssets)</h1>\n<p>Özelleştirilmiş BitAktifler  piyasa-sabitli-aktif çıkarmak isteyen fakat \nfiyatların tanıklar tarafından duyurulmasını istemeyen müşterilere hitab eder. Onun \nyerine, süren kimse <em>özelleştirilmiş</em> bitaktif yaratırken o aktif için özel olarak \nfiyatlarını duyurmaya müsadesi olan bir takım yetkililer belirleyebilir. Süren kimse\naktifle ilgili başka her türlü ücreti belirleyebilir ve kar elde edebilir.</p>\n<p>Bu özellik gerçek-zamanlı fiyatlara erişimi olan ve teşhir ve hacim arttırmak  isteyen \nborsalar ve kuruluşlar için ayrıca ilgi çekicidir.</p>\n';
			},
			38324: (e) => {
				e.exports =
					'<h1 id="kullanıcı-sürümü-aktifler-uia-user-issued-assets">Kullanıcı Sürümü Aktifler (UIA-User Issued Assets)</h1>\n<p>Daha önce bahsedilen <em>piyasaya sabitli varlıkların</em> yanısıra , META1 bireylere ve \nşirketlere, hayal edebilecekleri herşeye ait  kendi kuponlarını yaratma ve piyasaya \nsürme imkanı verir. Kullanıcı Sürümü Varlıklar (UIA) için potansiyel kullanım alanları \nsayısızdır. Bir tarafta UIA&#39;ler müşterilerin telefonlarına konser girişlerinde \nkullanabilecekleri basit organizasyon biletleri olarak yüklenebilirler. Diğer tarafta ise \nkitle fonlaması, mülkiyet takibi , ya da hisse şeklinde şirket özsermayesi satışında bile \nkullanılabilirler.</p>\n<p>Tabiiki, her tür kupona uygulanan kurallar çeşitlidir  ve her yetki bölgesinde farklılık \ngösterir. Dolayısıyla META1,  varlıklar piyasaya sürülürken , piyasaya süren kişinin \ngeçerli kanunlar çerçevesinde korunmasına yardımcı olacak araçlarla gelir -kanunların \nböyle varlıklara zaten izin verdiğini farz ediyoruz.</p>\n';
			},
