				e.exports =
					'<p>Bir aktif yaratmak için şunlar gerekli :</p>\n<ul>\n<li>Geçerli bir varlık sembolü</li>\n<li>0 (sıfır)dan büyük maksimum arz</li>\n</ul>\n<p>Hassasiyet , varlığın destekleyeceği ondalık hane sayısını belirler.</p>\n<p>Varlık yaratmanın masraf ücreti öncelikle varlığa ait sembolün uzunluğuna bağlıdır. </p>\n<p>Ücretlerin nekadarını tutacağınızı da piyasa ücreti ile yüzde olarak belirtebilirsiniz.</p>\n';
