					'<h4 id="i̇çindekiler">İçindekiler</h4>\n<ul>\n<li><a href="index.md"> Giriş </a></li>\n<li><a href="glossary.md">Terimler Listesi</a></li>\n<li><a href="introduction/wallets.md">Cüzdan</a></li>\n<li><a href="introduction/backups.md">Yedeklemeler</a></li>\n<li><a href="introduction/blockchain.md">Blokzinciri</a></li>\n<li><a href="introduction/witness.md">Tanık</a></li>\n<li><a href="introduction/workers.md">İşçiler</a></li>\n<li><a href="introduction/committee.md">Kurul Üyesi</a></li>\n<li><a href="accounts/general.md">Hesaplar</a></li>\n<li><a href="accounts/permissions.md">İzinler</a></li>\n<li><a href="accounts/membership.md">Üyelikler</a></li>\n<li><a href="assets/uia.md">Kullanıcı Aktifler</a></li>\n<li><a href="assets/privbitassets.md">Özelleştirilmiş BitAktifler</a></li>\n<li><a href="dex/introduction.md">Merkezsiz/dağıtık Borsa</a></li>\n<li><a href="dex/trading.md">Alış-Satış/Trade</a></li>\n<li><a href="dex/shorting.md">BitAktiflerin Kısa Satışları</a></li>\n</ul>\n';
