			63706: (e) => {
				e.exports =
					'<h1 id="账户">账户</h1>\n<p>或许你已经注意到，本区块链技术要求你注册一个账户名。这带来很多好处：这不仅增强了系统的可扩展性，同时我们可以将身份标示与交易授权签名分开。事实上，<em>拥有一个账户名<em>和能够</em>花费它的资金<em>是相互独立的。而且，这两种权利 (我们称之为</em>权限</em>)能够分散赋予任意复杂的人群关系中。我们称之为<em>职权实体</em>你可通过分配<em>权重</em>和设定 <em>门槛阀值</em>来实现。</p>\n';
			},
			34058: (e) => {
				e.exports =
					'<h1 id="会员级别">会员级别</h1>\n<p>META1 系统中，用户账户分为3个种类。我们运行用户升级账户到类似VIP的会员级别，享受费率折扣以及其他专属特性。</p>\n<h2 id="非会员普通账户">非会员(普通账户)</h2>\n<p>一个<em>非会员账户<em>，也就是一个</em>普通账户</em></p>\n<h2 id="终身会员">终身会员</h2>\n<p>终身会员账户可以从自己支付的各种手续费中获得一定比例的返现奖励，并有资格加入引荐计划，通过引荐或注册用户获得引荐奖励。升级到终身会员要求支付一笔一次性的升级费用，具体金额由理事会成员通过投票设定和调整。</p>\n<h3 id="手续费分配">手续费分配</h3>\n<p>每次你推荐的用户支付手续费时，该手续费将分配给多个不同账户。网络、推荐人都将获得一部分分成。</p>\n<p>注册人是账户注册时代其支付注册费的账户。注册人账户可自行决定剩余的手续费如何在它自己及它的市场合作方之间分配。</p>\n<h4 id="待结费用">待结费用</h4>\n<p>手续费每个维护周期在网络、推荐人和注册人之间结算一次。尚未结算的手续费称为<em>待结费用</em>。</p>\n<h4 id="待解冻金额">待解冻金额</h4>\n<p>大部分获取手续费的利益账户可立即使用资金，但金额超过一定数量的费用(比如支付升级终身会员的手续费、注册高级账户名的手续费等)则需要暂时冻结，并在一段时间内线性解冻释放。</p>\n';
			},
			50827: (e) => {
				e.exports =
					'<h1 id="权限">权限</h1>\n<p>在Meta (比特股)中，每一个账户的权限可分为</p>\n<ul>\n<li><strong>活跃权限</strong>: 控制资金</li>\n<li><strong>账户权限</strong>: 控制账户</li>\n</ul>\n<p>两者都可以通过钱包账户页面中<code>权限</code>标签进行设定。设定授权的<em>职权实体</em> (详见下文)以及分配相应的权重。只有高于门槛阀值权重的职权实体才能签署有效的交易。</p>\n<h2 id="授权账户">授权账户</h2>\n<p>在比特股系统中，一个职权实体通过一个或多个实体进行操作授权，比如转账或者交易。</p>\n<p>一个职权实体由一个或多个账户名加权重组合构成。</p>\n<p>参与签名的一个或多个实体的权重之和必须大于门槛阀值才能进行签署有效的交易动作。</p>\n<h1 id="示例">示例</h1>\n<p>现在让我们讨论几个例子来更好的理解这些术语以及使用场景。假设我们创建了一个新的账户，他的活跃权限如下文所述。请注意，同样的模式也适用于账户权限。</p>\n<h2 id="扁平结构-多重签名">(扁平结构) 多重签名</h2>\n<p>一个扁平结构的多重签名由<code>M</code>方实体参与，其中<code>N</code>个实体必须进行签名以使交易有效。现在，在比特股系统中，我们使用<em>权重</em>和<em>门槛阀值</em>来代替<code>M</code>和<code>N</code>。我们可以实现相同的功能，但是更加灵活。</p>\n<p>假设Alice，Bob，Charlie和Dennis管理一个共同基金。我们希望只要有2个人同意，我们就能构建一个有效的交易。也就是<strong>2-of-4</strong> (N-of-M)模式，这个结构如下：</p>\n<table>\n<thead>\n<tr>\n<th>账户名</th>\n<th>权重</th>\n</tr>\n</thead>\n<tbody><tr>\n<td>Alice</td>\n<td>33%</td>\n</tr>\n<tr>\n<td>Bob</td>\n<td>33%</td>\n</tr>\n<tr>\n<td>Charlie</td>\n<td>33%</td>\n</tr>\n<tr>\n<td>Dennis</td>\n<td>33%</td>\n</tr>\n<tr>\n<td>----------</td>\n<td>------</td>\n</tr>\n<tr>\n<td>门槛阀值:</td>\n<td>51%</td>\n</tr>\n</tbody></table>\n<p>这4个成员每人都有33%的权重，但是门槛阀值设定在50%。这样，至少需要2名成员同意才能获得多余门槛阀值的权重以签署有效交易。</p>\n<p>同理，要构建 3-of-4 结构，我们可以降低每个成员的权重值到 17%，或者增加门槛阀值到 99%。</p>\n<h2 id="扁平结构-灵活的多重签名">(扁平结构) 灵活的多重签名</h2>\n<p>通过门槛阀值和权重，现在我们管理资金时拥有了更多的灵活性，更准确的说，我们拥有了更多的<em>控制权</em>。比如，我们可以分配不同的权重到不同的成员。假设Alice希望通过多重签名机制来提高资金安全性防范偷窃，但又不想给与她的朋友们过多的控制权，那么，我们可以设定这样的职权实体分布：</p>\n<table>\n<thead>\n<tr>\n<th>账户名</th>\n<th>权重</th>\n</tr>\n</thead>\n<tbody><tr>\n<td>Alice</td>\n<td>49%</td>\n</tr>\n<tr>\n<td>Bob</td>\n<td>25%</td>\n</tr>\n<tr>\n<td>Charlie</td>\n<td>25%</td>\n</tr>\n<tr>\n<td>Dennis</td>\n<td>10%</td>\n</tr>\n<tr>\n<td>----------</td>\n<td>------</td>\n</tr>\n<tr>\n<td>门槛阀值:</td>\n<td>51%</td>\n</tr>\n</tbody></table>\n<p>这样，Alice只需要任何一个朋友协助就能使用资金，或者其他3个朋友必须全部同意才能使用资金。</p>\n<h2 id="多层次灵活的多重签名">多层次灵活的多重签名</h2>\n<p>我们再来看一下一种简单的企业常用的多层级组织架构。这个公司有一个首席财务官，有多个部门向其汇报，如Treasurer, Controller, Tax Manager, \nAccounting等。公司的首席执行官也要求拥有支付权。我们可以这样设计职权实体结构：</p>\n<table>\n<thead>\n<tr>\n<th>账户名</th>\n<th>权重</th>\n</tr>\n</thead>\n<tbody><tr>\n<td>CEO.COMPANY</td>\n<td>51%</td>\n</tr>\n<tr>\n<td>CFO.COMPANY</td>\n<td>51%</td>\n</tr>\n<tr>\n<td>------------</td>\n<td>------</td>\n</tr>\n<tr>\n<td>门槛阀值:</td>\n<td>51%</td>\n</tr>\n</tbody></table>\n<p>而 CEO.COMPANY 和 CFO.COMPANY 则拥有各自的职权实体。比如 CFO.COMPANY 账户可设置如下：</p>\n<table>\n<thead>\n<tr>\n<th>CFO.COMPANY</th>\n<th>权重</th>\n</tr>\n</thead>\n<tbody><tr>\n<td>Chief.COMPANY</td>\n<td>51%</td>\n</tr>\n<tr>\n<td>Treasurer.COMPANY</td>\n<td>33%</td>\n</tr>\n<tr>\n<td>Controller.COMPANY</td>\n<td>33%</td>\n</tr>\n<tr>\n<td>Tax Manager.COMPANY</td>\n<td>10%</td>\n</tr>\n<tr>\n<td>Accounting.COMPANY</td>\n<td>10%</td>\n</tr>\n<tr>\n<td>-------------------</td>\n<td>------</td>\n</tr>\n<tr>\n<td>门槛阀值:</td>\n<td>51%</td>\n</tr>\n</tbody></table>\n<p>这个设计允许：</p>\n<ul>\n<li>首席执行官使用资金</li>\n<li>首席财务官使用资金</li>\n<li>Treasurer连同Controller一起可以使用资金</li>\n<li>Controller或者Treasurer连同Tax Manager或者Accounting可以使用资金</li>\n</ul>\n<p>这样，通过设计构建灵活的职权实体，从而拥有任意层级的结构，将满足绝大多数企业使用场景。</p>\n';
			},
