			90273: (e) => {
				e.exports =
					'<h1 id="市场锚定资产">市场锚定资产</h1>\n<p>一种加密数字货币，拥有类似比特币的属性和优点，同时能保持价格与对应的全球接受的货币同步(比如美元)。具有很强的便利性和实用性，对管制免疫。Meta的市场锚定资产(MPA)可以实现这样的目的。市场锚定资产是一种新型的可自由交易的数字资产，通过差价合约(CFD)机制，它的价值能够追踪传统的对应资产的价值。</p>\n<p><em>SmartCoin</em> (市场锚定资产的另一种叫法)是一种数字货币，它的价值<em>总是</em>有100%或更多价值的比特股核心货币(META1)来支撑。这些BTS在差价合约(CFD)中，作为抵押物存在，并在任何时间可被赎回。</p>\n<p>市场锚定资产与众不同的一个特点在于，尽管它使用了有抵押的价差合约，它却能免于对手盘风险。这是由网络本身(软件协议)通过确保抵押充足，并在特定情况下进行强制清算的机制来实现的。</p>\n';
			},
			19423: (e) => {
				e.exports =
					'<h1 id="私有比特资产">私有比特资产</h1>\n<p>通过私有比特资产，某些用户可以发行市场锚地资产，然后并不依赖见证人发布的喂价信息。相反的，在创建<em>私有比特资产</em>时，发行人设定一组授权账号来发布喂价信息。发行人可以设置与该资产相关的各种费率参数。</p>\n<p>这个特性主要适用于一些中心化交易所和机构，它们往往能够获得实时的价格信息，并以此来增加交易量。</p>\n';
			},
			34286: (e) => {
				e.exports =
					'<h1 id="用户发行的资产">用户发行的资产</h1>\n<p>除了之前提到的 <em>市场锚定资产</em> 外，Meta允许个人或公司用户创建和发行各种自定义资产凭证(UIA)。相关的应用场景数不胜数。比如，UIA可被用来代替简单的活动门票，存入合格用户的手机钱包中，在进入活动现场时进行实时验证。同样，UIA可被用来进行众筹、所有权追踪，甚至是代表公司的股权。</p>\n<p>显然，适用于不同凭证使用场景的法律法规可能天差地别，尤其是在不同国家时。所以，Meta提供了一组工具来帮助发行人来合规发行和管理UIA。</p>\n';
			},
			92648: (e) => {
				e.exports =
					'<p>创建自定义资产需要以下信息：</p>\n<ul>\n<li>资产符号</li>\n<li>最大供给量</li>\n</ul>\n<p>精度决定了资产支持的小数点后的位数。</p>\n<p>资产创建需要支付的费用取决于资产符号的字符长度。</p>\n<p>你可以设定交易手续费率来决定用户交易时需要向你支付多少比例的费用。</p>\n';
			},
			72231: (e) => {
				e.exports =
					'<p>[# lifetime]</p>\n<h3 id="可获得-feescashback-手续费返现奖励">可获得 {feesCashback}% 手续费返现奖励</h3>\n<p>终身会员可获得自己支付的每笔交易手续费的{feesCashback}%的现金返现，并自动作为推荐人加入引荐计划，通过引荐用户注册获得推荐奖励。升级到终身会员只需要花费 {price}。</p>\n<p>[# annual]</p>\n<p>如果你暂时不想成为终身会员，那么你还可以选择升级到年度会员，可获得 {feesCashback}% 的手续费返现。升级为年度会员，每年只需花费 {price}。</p>\n<p>[# fee-division]</p>\n<h4 id="手续费分配">手续费分配</h4>\n<p>每次 {account} 支付交易手续费时，该手续费将分配给多个不同账户。网络将收取 {networkFee}%，引荐 {account} 的推荐人账户将获得 {lifetimeFee}%。</p>\n<p><em>注册人账户</em> 是在 {account} 注册时代其支付注册费的账户。注册人账户可自行决定剩余的 {referrerTotalFee}% 手续费如何在它自己及它的 <em>合作推荐人</em> 之间分配。</p>\n<p>{account}的注册人账户决定与它的_合作推荐人_分享{referrerFee}%手续费，自己保留{registrarFee}%。</p>\n<h4 id="待结费用">待结费用</h4>\n<p>{account} 支付的手续费每个维护周期 ({maintenanceInterval} 秒)在网络、推荐人和注册人之间结算一次。下一个维护时间在 {nextMaintenanceTime}。</p>\n<h4 id="待解冻金额">待解冻金额</h4>\n<p>大部分获取手续费的利益账户可立即使用资金，但金额超过{vestingThreshold}的费用(比如支付升级终身会员的手续费、注册高级账户名的手续费等)则需要暂时冻结，并在{vestingPeriod}天内线性解冻释放。</p>\n';
			},
